select top 10 * from sales_order


--?  Find difference in average sales for each month for 2003 and 2004?

select distinct year_id from sales_order

--select distinct year(order_date) as yr
--from sales_order

with avg_sales as
(
select datename(month,order_date) as mnth
		,year(order_date) as yr
		,avg(sales) as average_sales
from sales_order 
where year(order_date) in (2003,2004)
group by datename(month,order_date), year(order_date)
)


select mnth_2003, mnth_2004, average_sales_2003, average_sales_2004,
		round((average_sales_2004 - average_sales_2003),2) as diff_avg
from
(
select mnth as mnth_2003, yr, average_sales as average_sales_2003
from avg_sales
where yr = 2003
) avg_2003
full join
(
select mnth as mnth_2004, yr, average_sales as average_sales_2004
from avg_sales
where yr = 2004
) avg_2004
on avg_2003.mnth_2003 = avg_2004.mnth_2004
